  const [oprionOne, setOptionOne] = useState({
    title:'第一个dragDiv'
  })
  const moreClick = () => {
    console.log('tell me which num')
  }
  const clickPendingNum = () => {
    console.log('overview 点击待处理数量')
  }
  return (
    <div>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title='第一个dragDiv'>
        <div style={{height: '100px',width: '100px', backgroundColor:'orange'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title='第二个dragDiv' pendingNum="2" clickPendingNum={clickPendingNum} moreClick={moreClick}>
        <div style={{height: '100px',width: '100px', backgroundColor:'red'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title='第三个dragDiv' pendingNum="3" clickPendingNum={clickPendingNum}>
        <div style={{height: '100px',width: '100px', backgroundColor:'green'}}></div>
      </Drag>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title='第四个dragDiv' pendingNum="4" clickPendingNum={clickPendingNum}>
        <div style={{height: '100px',width: '100px', backgroundColor:'blue'}}></div>
      </Drag>
    </div>
  );
}
